	public static int loop = 0;
	public static int majorityElement2(int[] nums) {
		Map<Integer, Integer> map = new HashMap<Integer, Integer>();
		
		for(int i = 0; i < nums.length; ++ i) {
			if(map.containsKey(nums[i])) {
				map.put(nums[i], map.get(nums[i]) + 1);
			} else {
				map.put(nums[i], 1);
			}
		}
		int[] tmp = new int[2];
		for(Map.Entry<Integer, Integer> entry : map.entrySet()) {
			if(entry.getValue() > tmp[1]) {
				tmp[0] = entry.getKey();
				tmp[1] = entry.getValue();
			}
		}
		
		return tmp[0];
	}
	
	public static int majorityElement(int[] nums) {
		int result = 0;
		int length = (int)Math.log(nums.length);
		if(length < 10) {
			if(nums.length > 10) {
				length = 10;
			} else {
				length = nums.length;
			}
		}
		int sn = 0;
		boolean newSample;
		int[] sample = new int[length];
		int[] sr = new int[2];
		int i = 0, j = 0;
		while(true) {
			loop ++;
			sn = 0;
			for(i = 0; i < length; ++ i) {
				sample[i] = nums[(int)(Math.random() * nums.length)];
			}
			int[][] count = new int[length][2];
			for(i = 0; i < length; ++ i) {
				newSample = true;
				for(j = 0; j < sn; ++ j) {
					if(count[j][0] == sample[i]) {
						count[j][1] ++;
						newSample = false;
					}
				}
				if(newSample) {
					count[j][0] = sample[i];
					count[j][1] = 1;
					sn ++;
				}
			}
			sr = count[0];
			for(i = 1; i < sn; ++ i) {
				if(count[i][1] > sr[1]) {
					sr = count[i];
				}
			}
			for(i = 0, j = 0; i < nums.length; ++ i) {
				if(nums[i] == sr[0]) {
					j ++;
				}
			}
			if(j > nums.length / 2) {
				result = sr[0];
				break;
			}
		}
		
		return result;
	}
